//                  CONTACT PAGE AS A COMPONENT                   \\

// Importing Modules :
import React from 'react';

import { Name , ID } from "./App"

const Contact = (props) => {
    return (
        <Name.Consumer>
            {
                (data) => {
                    console.log("This is Provide", data)
                    return (
                        <>
                            This is CONTACT-US Pageasdasd {props.name} {props.id}.
                        My name is {data}
                        </>
                    )
                }
            }
        </Name.Consumer>
    )
}

// Exporting Contact COmponent :
export default Contact;
